export async function dropDownClientMenu(t){try{const o=t.target.closest('[data-action="manage-client"]');if(!o)return;t.preventDefault(),t.stopPropagation();const e=o.dataset.target;if(!e)return;const n=o.closest(".w3-dropdown-content")||document;n.querySelectorAll(".w3-dropdown-content.w3-show").forEach((t=>{t.id!==e&&t.classList.remove("w3-show")}));const c=document.getElementById(e);c&&c.classList.toggle("w3-show")}catch(t){throw t}}